import React, { Component } from "react";
import { MDBBtn, MDBCol, MDBContainer, MDBRow } from "mdbreact";
import "./index.css";
import Navbar from './components/NavBar';
import About from "./components/About";
import Toolkit from "./components/ToolKit";
import Projects from "./components/Projects";
import Contact from "./components/Contact";
import Footer from "./components/Footer";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavbarToggler,
  MDBCollapse,
  MDBNavItem,
  MDBNavLink,
  MDBAnimation,
  MDBMask,
  MDBView,
  MDBCard,
  MDBCardBody,
  MDBSmoothScroll
} from "mdbreact";

import { BrowserRouter as Router } from "react-router-dom";


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      collapse: false,
      isWideEnough: false
    };
    this.onClick = this.onClick.bind(this);
  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse
    });
  }

  render() {
    return (
<div>
  <router>
    <mdbnavbar color=" rgba-brown-strong" dark expand="md" fixed="top">
      <mdbnavbarbrand href="/">
        SC
      </mdbnavbarbrand>
      {'{'}!this.state.isWideEnough &amp;&amp; (
      <mdbnavbartoggler onclick="{this.onClick}">
        ){'}'}
        <mdbcollapse isopen="{this.state.collapse}" navbar>
          <mdbnavbarnav left>
            <mdbnavitem active>
              <mdbnavlink to="../Home">Home</mdbnavlink>
            </mdbnavitem>
            <mdbnavitem>
              <mdbnavlink to="../components/About">About</mdbnavlink>
            </mdbnavitem>
            <mdbnavitem>
              <mdbnavlink to="/components/Toolkit">Skills</mdbnavlink>
            </mdbnavitem>
            <mdbnavitem>
              <mdbnavlink to="/components/Projects">Projects</mdbnavlink>
            </mdbnavitem>
            <mdbnavitem>
              <mdbnavlink to="/components/Contact">Contact</mdbnavlink>
            </mdbnavitem>
          </mdbnavbarnav>
        </mdbcollapse>
      </mdbnavbartoggler></mdbnavbar>
  </router>
  <mdbview src="http://www.sabusinessindex.co.za/wp-content/uploads/2017/08/Digital-Leadership.jpg">
    <mdbmask overlay="black-light" classname="flex-center flex-column text-white text-center">
      <mdbcard color="rgba-brown-light" text="white" classname="text-center">
        <mdbcardbody>
          <mdbanimation type="fadeIn" duration="2s">
            <h1>Shaniece Crumpler</h1>
          </mdbanimation>
          <mdbanimation type="fadeIn" duration="2s" delay="1.5s">
            <h5>Front-End Engineer</h5>
          </mdbanimation>
          <mdbanimation type="fadeIn" duration="2s" delay="3.2s">
            <p>
              “ Code is like humor. When you have to explain it, it’s
              bad.” – Cory House{'{'}" "{'}'}
            </p>
          </mdbanimation>
        </mdbcardbody>
      </mdbcard>
    </mdbmask>
  </mdbview>
  <about>
    <toolkit>
      <projects>
        <contact>
          <footer>
          </footer></contact></projects></toolkit></about></div>


    );
  }
}

export default App;
